import React from 'react';
import {Add,Sub,mult,div} from './Calc';
import Card from "./Card";
import Ndata from "./Ndata";
import Netflix from './Netflix';
import Amazon from './Amazon';

// const favN = "Netflix";

const netFlix = () =>{
    return <Netflix />;
}

const amaZon = () =>{
    return (    
        <Card 
        key={Ndata[2].id}
        imgscr ={Ndata[2].imgscr} 
        title = {Ndata[2].title} 
        sname = {Ndata[2].sname} 
        link = {Ndata[2].link}                 
        />
   
);
}

function App(){
return(
    <>
    <div className = "main_box">
        
        <div className = "leftDiv">
        <h1> 
        <button onClick = {netFlix}>Netflix</button>
        <button onClick = {amaZon}>Amazon</button>
        
        </h1>
        <h1 className = "heading">Netflix Series</h1>
            
        

            {/* { (favN === "Netflix") ?  <Netflix /> : <Amazon /> } */}
            
          
        </div>
        <div className = "rightDiv"> 
        <h1 className = "heading">Calculate Amount</h1>           
            <h2>Add : {Add(60,4)}</h2>
            <h2>sub : {Sub(60,4)}</h2>
            <h2>mult : {mult(60,4)}</h2>
            <h2>div: {div(60,3)} My Smily </h2>
        </div>
    </div>
    </>
);
}

export default App;
